(10, 'Текст объявления Шины Дром для регионов', 'Если вы видите это объявление, значит шины не проданы. \r\nШины находятся в г. [+ATTR=27+]. Отправка до склада ТК в город размещения объявления за мой счет. \r\n[+LIST=12+] На вопрос "На мое авто подойдут?" не отвечаю. Обмен не интересен. Торг минимальный либо отсутствует. Возможен резерв товара на срок до месяца по предоплате. Продаются без дисков. Диски выложены отдельно в нашей базе. Товар б/у. \r\n\r\n[+INTER=14+]', 1, 'managerActions', 0),
