(19, 'Сверловка соответствие', '[+LIST=17+]', 2, 'managerActions', 60),
(20, 'Параметры Диски Тело Объявления', 'Количество дисков: [+ATTR=28+] шт.`(strlen("[+ATTR=6+]")>1)?("\\nПроизводитель: [+ATTR=6+]"):(" ")` \r\nДиаметр: [+ATTR=9+]\r\nСверловка: [+ATTR=5+]\r\nШирина: [+ATTR=31+]`("[+ATTR=32+]"==0)?(""):("\\nВылет: [+ATTR=32+]")``("[+ATTR=33+]"==0)?(""):("\\nЦО: [+ATTR=33+]")``("[+ATTR=34+]"==0)?(""):("\\nВес: [+ATTR=34+]")``(strlen("[+ATTR=11+]")>1)?("\\nMade in: [+ATTR=11+]"):("")` `(strlen("[+ATTR=35+]")>1)?("\\nОписание: [+ATTR=35+]"):("")`', 2, 'managerActions', 150),
